      title: 'Python',
      amount: 40.9,
      date: new Date(2021, 2, 28)
    },
    {
      id: 2,
      title: 'Go',
      amount: 30.9,
      date: new Date(2021, 2, 28)
    },
    {
      id: 3,
      title: 'React',
      amount: 60.9,
      date: new Date(2021, 2, 28)
    },
    {
      id: 4,
      title: 'Django',
      amount: 80.9,
      date: new Date(2021, 2, 28)
    }
  ];


  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem 
      title={expense[0].title} 
      amount={expense[0].amount} 
      date={expense[0].date}
      />
