      title={expense[1].id} 
      amount={expense[1].amount} 
      date={expense[1].date}
      />
      <ExpenseItem 
      title={expense[0].id} 
      amount={expense[0].amount} 
      date={expense[0].date}
      />
      <ExpenseItem 
      title={expense[0].id} 
      amount={expense[0].amount} 
      date={expense[0].date}
      />
    </div>
  );
}

export default App;
